INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES (1, 0, "ふむ、よい趣向ですね。\n敬うべき相手を忘れず、恩を忘れず、\n健勝を祝う宴を開く……\n礼節を弁えた人間は好きですよ。", 107011, 0, 1070501, 1070501040, 1, 11, 4, "");
