INSERT INTO `v1_db069f76b38365436db7fe30685d8e674fd9b10ea9af6c4341ef31b7877eebf9` VALUES (1, 0, "是非もなし。\n端的に言えば、先輩ちょっと感激した。\n今宵は飲めや食えやの大騒ぎだ。\n朝まで踊り明かすぜ同志、ヒャッハー！", 111011, 0, 1110501, 1110501052, 1, 11, 5, "");
